nconsole.log(arr, temp); // [1, 2] 3"}]},{"title":"splice","list":[{"txt":"作用：删除、插入、替换数组项"},{"txt":"语法：arr.splice(start[, deleteCount[, item1[, item2[, ...]]]])","list":["start​: 指定修改的开始位置（从0计数）,如果超出了数组的长度，则从数组末尾开始添加内容；如果是负值，则表示从数组末位开始的第几位（从-1计数，这意味着-n是倒数第n个元素并且等价于array.length-n）；如果负数的绝对值大于数组的长度，则表示开始位置为第0位","deleteCount：整数，表示要移除的数组元素的个数，从start开始。如果 deleteCount <= 0，则不移除元素，这种情况下，至少应添加一个新元素","item1, item2, ...：要添加进数组的元素，如果不指定，则 splice() 将只删除数组元素"]},{"txt":"返回值：删除项组成的数组，如果没有删除元素，则返回空数组。"},{"txt":"原数组是否改变：是"}],"eg":[{"type":"code","content":"let arr = [1, 2, 3]; \\n// 插入元素 \\nlet temp = arr.splice(1, 0, \'a\', \'b\'); // 在索引1的位置插入元素\'a\'和\'b\' \\nconsole.log(arr, temp); // [1, \'a\', \'b\', 2, 3] [] \\n// 删除元素 \\nlet temp1 = arr.splice(1, 2); // 删除从索引1的位置开始的2项 \\nconsole.log(arr, temp1); // [1, 2, 3] [\'a\', \'b\'] \\n// 替换一个元素 \\nlet temp2 = arr.splice(1, 1, \'a\'); // 将索引1的位置的元素替换为\'a\' \\nconsole.log(arr, temp2); // [1, \'a\', 3 ] [2] \\n// 替换多个元素 \\nlet temp3 = arr.splice(0, 2, \'b\', \'c\'); // 将索引0的位置开始的两项，替换成’b‘和’c‘ \\nconsole.log(arr, temp3); // [’b‘, \'c\', 3] [1, \'a\'] \\n// 只传第一个参数，则删除从第一个参数指定的位置到数组结尾的所有项 \\nlet temp4 = arr.splice(0); //从索引0的位置开始，删除后面的所有项 \\nconsole.log(arr, temp4); // [] [’b‘, \'c\', 3]"}]},{"title":"slice","list":[{"txt":"作用：截取指定位置的数组"},{"txt":"语法：arr.slice([begin[, end]])","list":["begin：索引开始（从 0 开始），如果该参数为负数，则表示从原数组中的倒数第几个元素开始提取","end：索引终止（从 0 开始），如果该参数为负数， 则表示在原数组中的倒数第几个元素结束抽取"]},{"txt":"返回值：返回截取的元素组成的数组,包括 begin，不包括end"},{"txt":"原数组是否改变：否"}]},{"title":"concat","list":[{"txt":"作用：合并数组"},{"txt":"语法：arr.concat(value1[, value2[, ...[, valueN]]])","list":["参数的类型可以是任意类型","数据类型如字符串，数字和布尔（不是String，Number 和 Boolean 对象）：concat将字符串和数字的值复制到新数组中","对象引用（而不是实际对象）：concat将对象引用复制到新数组中。 原始数组和新数组都引用相同的对象。 也就是说，如果引用的对象被修改，则更改对于新数组和原始数组都是可见的。 这包括也是数组的数组参数的元素","对于新数组的任何操作（仅当元素不是对象引用时）都不会对原始数组产生影响，反之亦然"]},{"txt":"返回值：合并之后的数组"},{"txt":"原数组是否改变：否"}]},{"title":"join","list":[{"txt":"作用：使用分隔符(默认为逗号)，将数组转为字符串"},{"txt":"语法：arr.join([separator])"},{"txt":"返回值：转化后的字